Z. Ertz\",\"proTeamAbbreviation\":\"PHI\",\"position\":\"TE\",\"headshotUrl\":\"https://d26bvpybnxg29h.cloudfront.net/nfl/9376.png\",\"nflByeWeek\":9,\"injury\":{\"typeAbbreviaition\":\"IRD\",\"description\":\"Ankle\",\"severity\":\"OUT\",\"typeFull\":\"IR Designated for Return\"},\"news\":[{\"timeEpochMilli\":\"1605727787000\",\"contents\":\"Ertz (ankle) is practicing Wednesday, Daniel Gallen of The Harrisburg Patriot-News reports.\",\"analysis\":\"The Eagles designated Ertz to return from injured reserve, opening a 21-day window for the team to make a decision between bringing him back to the active roster or ruling him out for the rest of the season. Ertz's practice participation suggests it will be the former, though it isn't certain he'll be activated before Sunday's game in Cleveland. The veteran tight end suffered a high-ankle sprain Week 6, leaving Richard Rodgers in a three-down role for a Week 7 win over the Giants. Dallas Goedert then returned from his own ankle injury for Week 8, logging 84 and 93 percent of snaps the past two games. Ertz's return figures to impact Goedert's playing time, though it was the 25-year-old who was more productive back in September when both tight ends were healthy.\",\"title\":\"Returns to practice\"},{\"timeEpochMilli\":\"1605712518000\",\"contents\":\"The tight end position has been a crapshoot all year, which even the seemingly dependable options like Zach Ertz, George Kittle, and Mark Andrews either hurt or failing to meet expectations. That has left the landscape as Travis Kelce and a whole bunch of other guys, which has amounted to a massive headache for fantasy players. However, we all have to find an option, and if you've made it this far without a clear solution at the position, then you might be looking for a white knight to fight ...\",\"url\":\"https://www.rotoballer.com/playoff-tight-ends-to-stream-or-add/805089\",\"title\":\"Playoff Tight End Streamers: ROS Schedules to Attack\"}],\"nameFirst\":\"Zach\",\"nameLa