seven carries for 42 yards and added one catch for 31 yards on two targets against the Patriots.\",\"analysis\":\"Mark Ingram was back, which impacted the snap distribution in the Baltimore backfield. Still, Edwards was effective when on the field. His snap share fell below 25 percent but Edwards is still seeing carries on a high percentage of his snaps. Put another way, Edwards has a 44.3 percentage of snaps with a touch, which is 63rd percentile among running backs. It's also worth noting that Edwards has gotten some work in the passing game the last three weeks; Edwards had three targets in six games before the bye and now has three catches for 42 yards in three games since the bye. It's not a significant target volume, but given Edwards' previous absence from the passing game, this is a development worth monitoring in the coming weeks. Baltimore hosts Tennessee on Sunday.\",\"title\":\"Over 70 yards from scrimmage\"}],\"nameFirst\":\"Gus\",\"nameLast\":\"Edwards\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"BAL\",\"location\":\"Baltimore\",\"name\":\"Ravens\"},\"externalIds\":[{\"id\":\"3ffc3993-461e-4477-9def-c9633b7feac1\"}],\"positionEligibility\":[\"RB\"]},\"requestedGames\":[{\"game\":{\"id\":6301,\"away\":{\"abbreviation\":\"TEN\",\"location\":\"Tennessee\",\"name\":\"Titans\"},\"home\":{\"abbreviation\":\"BAL\",\"location\":\"Baltimore\",\"name\":\"Ravens\"},\"startTimeEpochMilli\":\"1606068000000\",\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true}},\"stats\":[{\"category\":{\"id\":22,\"abbreviation\":\"Yd\",\"nameSingular\":\"Rushing Yard\",\"namePlural\":\"Rushing Yards\"}},{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"}},{\"category\":{\"id\":29,\"abbreviation\":\"TD\",\"nameSingular\":\"Offensive + Special